// Question 02

let heading = document.getElementById('heading');
let h1 = document.createElement('h1');
h1.innerHTML = "Mobile Phone Lookup";
h1.style.color = "blue";
heading.appendChild(h1);

let mobileGallery = document.getElementById("mobileGallery");

let mobileList = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,"
];
for(let i = 0; i < mobileList.length; i++){
    let img = document.createElement('img');
    img.src = mobileList[i];
    img.alt = "Mobile-Image";
    img.classList.add("mobile-images");
    img.addEventListener('click', function(){
        alert(`You Clicked on ${this.alt}`);
    });
    mobileGallery.appendChild(img);
}

