// Question 05

let counterValue = 0;
let counter = document.getElementById('counter');

function updateCounter(){
    counter.textContent = counterValue
}
function increaseCounter(){
    counterValue++
    updateCounter()   
}
function decreaseCounter(){
    counterValue--
    updateCounter()   
}